INSERT INTO `bquiz_question` VALUES (11,'In Indian mythology, it is a beautiful, supernatural female being. It is youthful and elegant and superb in the art of dancing. Its name translates to ‘celestial maiden’ in English. A famous brand shares its name with such a being. What are we talking abou','random','',20,100,'TXT',0,'2019-08-16 16:29:27.892187','2019-08-22 10:00:30.817696',2),(12,'These were first introduced by Ferrero in 1969, under the name \"Refreshing Mints\". In 1970, they were re-named after the distinctive sound of the mints rattling in their container. What is being talked about?','r','',20,100,'TXT',0,'2019-08-16 16:30:48.691553','2019-08-22 10:01:10.890911',2),(13,'Their name is derived from the Latin words bis (twice) and coquere (to cook), and, hence, means \"twice-cooked\". This is because they were originally cooked in a twofold process: first baked, and then dried out in a slow oven. What are we talking about ?','r','',20,100,'TXT',0,'2019-08-16 16:31:54.206327','2019-08-22 10:01:50.949846',2),(14,'Motorola Droid was an Android smartphone that was released in 2009. From which famous filmmaker did Motorola have to acquire a license in order to name their phone?','r','',20,100,'TXT',0,'2019-08-16 16:32:29.536205','2019-08-22 10:02:31.023538',2),(15,'This term comes from the French marché aux puces, a name originally given to a market in Paris which specialized in shabby second-hand goods of the kind that might contain small flightless insects. What are we talking about?','r','',20,100,'TXT',1,'2019-08-16 16:33:09.748467','2019-08-22 10:02:31.029530',2);
