INSERT INTO `events_event` VALUES (12,'IGNITION','E-hall','2018-08-01','10:00 am','\"Ignition\" is a business model competition that will connect ideas of entrepreneurs with investors. This will help the startups to gain traction and also provide an opportunity to be funded by some of the top investors in india. A business model competition aims to connect the new start-ups with investors by creating a direct channel between them.','static/uploads/events/cover/ig111.png','static/uploads/events/icon/ig111.png','bmodel.ecellnitrr@gmail.com',1,2019,'2019-07-26 13:38:06.046435','2019-07-31 18:29:42.194285',NULL),(13,'START-UP CAMP','To be decided...','2018-09-09','TBD','In a startup nothing happens unless you make it happen. Startup camp promotes entrepreneurship among students and also provides a start-up initiative activity amongst the growing startups in and around Chhattisgarh. Several high scale and low scale startups in and around Chhattisgarh are invited and provided with an opportunity to publicize their products/services and grab some interns for their companies. The investors attend the pitches of the startups and on recognizing a potential startup, provide seed funding to those startups.','static/uploads/events/cover/sc111.png','static/uploads/events/icon/sc111.png',NULL,1,2019,'2019-07-26 13:38:14.032085','2019-07-26 13:38:14.032140',NULL),(14,'CRICNOMETRICA','To be decided...','2018-09-08','TBD','Cricnometrica is an event designed to provide a stage for entertainment as well as a platform to showcase the individuals or teams knowledge of the game of cricket. A team game comprising of three rounds which range from pen paper to slide-shows and leads finally to virtual bidding to create a team of their own. The team with the maximum points at the end of the third round is declared as the winner.','static/uploads/events/cover/cr111_wKu2qYt.png','static/uploads/events/icon/cr111_wKu2qYt.png',NULL,1,2019,'2019-07-26 13:38:21.254730','2019-07-26 13:38:21.254784',NULL),(15,'B-QUIZ','To be decided...','2018-09-08','TBD','Get your cortex fixed cause this quiz spins your head around. Let\'s explore some of the de facto of business quizzing. Guide your cerebrum\'s way to this b-quiz that will catapult you into the world of business facts and figures.','static/uploads/events/cover/bq111.png','static/uploads/events/icon/bq111.png',NULL,1,2019,'2019-07-26 13:38:28.778598','2019-07-26 13:38:28.778651',NULL),(16,'WALLSTREET','To be decided...','2018-09-08','TBD','A virtual share market contest for the brokers out there. Invest money and take home big. The winner keeps it all. Challenge your mind’s trafficking power and run away with the best bet in this virtual stock broking exchange.','static/uploads/events/cover/wallstreet_FwBl6yR111.png','static/uploads/events/icon/wallstreet_FwBl6yR111.png',NULL,1,2019,'2019-07-26 13:38:38.916571','2019-07-26 13:38:38.916624',NULL),(17,'UTKRISHTH','To be decided...','2018-09-08','TBD','This event acknowledges the grass root works and aims at promoting low scale entrepreneurs from villages for the progress of nation. The event aims at felicitating the potential rural startup ideas to promote the entrepreneurial spirit at the grass root levels.','static/uploads/events/cover/uk111.png','static/uploads/events/icon/uk111.png',NULL,1,2019,'2019-07-26 13:38:48.703142','2019-07-26 13:38:48.703196',NULL),(18,'ENTROPY','To be decided...','2018-09-08','TBD','Giving wings to ideas and ground to the unknown, this session is to guide, inspire and bring out the best from the budding comrades. Words, if they hit the adrenaline rush can make you do wonders. This speaker session can make you look beyond the ordinary in order to be above the ordinary.','static/uploads/events/cover/en111.png','static/uploads/events/icon/en111.png',NULL,1,2019,'2019-07-26 13:38:55.298656','2019-07-26 13:38:55.298710',NULL),(19,'E-GATHERING','To be decided...','2018-09-08','TBD','Like to end the E summit 18 on a high, the closing ceremony called the E-Gathering will feature a musical performance and a stand-up performance which will be revealed soon.','static/uploads/events/cover/eg111.png','static/uploads/events/icon/eg111.png',NULL,1,2019,'2019-07-26 13:39:02.570581','2019-08-20 16:11:17.810311',NULL),(20,'B-CASE STUDY','To be decided...','2018-09-08','TBD','B-Case Study (Business Case Study ) is an event designed to act as a solution provider for the erupting real life scenarios in the business domain. A team event comprising of three rounds with range from pen paper to a final report submission. The reports being presented before the judges and the team with maximum awarded points is declared as the winner.','static/uploads/events/cover/bc111.png','static/uploads/events/icon/bc111.png',NULL,1,2019,'2019-07-26 13:39:09.840846','2019-08-20 16:11:03.489978',NULL),(22,'INNOVATION MANTHAN','TPO Terrace','2019-06-29','TBD','A stepping stone for your future startup ideas.','static/uploads/events/cover/Event_Logos-20.png','static/uploads/events/icon/Event_Logos-20.png',NULL,1,2019,'2019-07-26 13:39:19.490019','2019-08-20 17:18:48.960738',NULL);
